import React, { useEffect, useState } from "react";

const MojePorudzbine=()=>{

    const [porudzbine, setPorudzbine]=useState([]);

    useEffect(()=>{
        fetch("https://localhost:44388/Porudzbina/allPorudzbineProdavca?korisnikId=11", {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json',
            },
            mode: 'cors',
        })
        .then((response)=> response.json())
        .then((data)=>{
            console.log(data);
            setPorudzbine(data);
        })
        .catch((error)=>{
            console.error("Greška prilikom dobavljanja podataka sa servera:", error);
        });
    },[]);


    return(
        <div>
            <h1 style={{color: "#279980"}}>Moje porudzbine</h1>
            <table>
                <thead>
                    <tr>
                        <th>Adresa Dostave</th>
                        <th>Komentar</th>
                        <th>Vreme isporuke</th>
                    </tr>
                </thead>
                <tbody>
                {sortedArtikli.map((porudzbina))}    
                </tbody>
                
            </table>
        </div>
    );
};

export default MojePorudzbine;
